import React from "react";

const CustomButton = (props) => (
  <a
    style={{ backgroundColor: props.backgroundColor, color: props.color }}
    className={`button ${props.className}`}
    id={props.id}
    href={props.href || "#"}
    target={props.target}
  >
    {props.children}
  </a>
);

export default CustomButton;
